DROP TABLE IF EXISTS "dublin_hospital" CASCADE;
CREATE TABLE "dublin_hospital" ( "pkid" SERIAL not null PRIMARY KEY,
  "wkb_geometry" geometry,
  "id" VARCHAR(254),
  "amenity" VARCHAR(254),
  "building" VARCHAR(254),
  "name" VARCHAR(254),
  "type" VARCHAR(254)
);
CREATE INDEX "dublin_hospital_wkb_geometry_geom_idx" ON "dublin_hospital" USING GIST ("wkb_geometry");



alter table dublin_hospital drop column if exists building;
alter table dublin_hospital drop column if exists type;
alter table dublin_hospital add column yelp_postc VARCHAR(50);
